webpackJsonp([0x834755aae49e],{519:function(t,e){t.exports={data:{markdownRemark:{html:'<p>Hello there.<br>\nThis site was built with the static site generator "Gatsbyjs".  </p>\n<p>Everyone can easily create a SPA site with React.<br>\n<a href="https://www.gatsbyjs.org/">https://www.gatsbyjs.org/</a>  </p>\n<p>Is that true? I don\'t know if it is as easy as it is told.<br>\nFirst, I had some difficulty building a development environment.<br>\n(I did not expect Visual Studio 2017 to have a negative impact...)  </p>\n<p>However, once the flow can be established it is definitely useful.<br>\nBecause it does not use DB, it is good that the infrastructure is simple.<br>\nSince it is only a static file, it is easy to revert to an arbitrary point if using version control like git.  </p>\n<p>It is a good era to have lots of convenient services.  </p>\n<p>Additional note:<br>\nAt a later date, an unknown problem occurred around GraphQL, and it was not built correctly.\nSometimes it\'s fixed after removed the cache, but it may not.\nGatsby still seems to bring instability.</p>',timeToRead:1,excerpt:'Hello there. This site was built with the static site generator "Gatsbyjs".   Everyone can easily create a SPA site with React. https://wwwâ€¦',frontmatter:{title:"Hello world",cover:"https://unsplash.it/400/300/?random?TheFallenTime",date:"2018-04-03",category:"tech",tags:["GatsbyJS"]},fields:{nextTitle:"Why does life prefer continuity",nextSlug:"/why-does-life-prefer-continuity",prevTitle:"What exists exists, what not exists not exists",prevSlug:"/what-exists-exists-what-not-exists-not-exists",slug:"/hello-world"}}},pathContext:{slug:"/hello-world"}}}});
